import React from "react";
import logo from "./logo.svg";
import upward from "./upward-trend-flat.png";
import downward from "./downward-trend-flat.png";
import "./App.css";
import FeatureItem from "./FeatureItem/FeatureItem.js";
import ChartComponent from "./Chart/Chart.js";
import { Link, BrowserRouter, Route } from "react-router-dom";
import Markets from "./Markets/Markets";

function App({ name }) {
  const handleQuoteChange = symbol => {};
  return (
    <div className="App">
      <header className="App-header">
        <Markets />
        <FeatureItem
          src={upward}
          symbol="symbol"
          name={name}
          price="5,097"
          day_change="+"
          change_pct="33.45"
          color="green"
        />
        <FeatureItem
          src={downward}
          symbol="symbol"
          name="Streams"
          price="47,403"
          day_change="-"
          change_pct="112.45"
          color="red"
        />
        <FeatureItem
          src={upward}
          symbol="symbol"
          name="Engagement Rate"
          price="25.81"
          day_change="+"
          change_pct="62.52"
          color="green"
        />
        <FeatureItem
          src={upward}
          symbol="symbol"
          name="Average Watch Time"
          price="45,4 min"
          day_change="+"
          change_pct="4.46"
          color="green"
        />
        <ChartComponent />
      </header>
    </div>
  );
}

export default App;
